import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for any "Your Profile" link using a unique XPath to avoid previous selector strategies
    // We'll select the LAST occurrence of "Your Profile" link to ensure uniqueness
    const profileLinkXPath = `(//a[normalize-space(text())='Your Profile'])[last()]`;
    await page.waitForSelector(`xpath=${profileLinkXPath}`, { timeout: 5000 });

    // Highlight the element for screenshot (optional visual feedback)
    await page.evaluate((xpath) => {
      const el = document.evaluate(xpath, document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
      if (el) el.style.outline = '3px solid #ff9900';
    }, profileLinkXPath);

    // Take screenshot before clicking
    const step2 = path.join(screenshotsDir, 'step_2_profile_link_highlighted.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Your Profile" link
    const [profileLink] = await page.$x(profileLinkXPath);
    if (!profileLink) throw new Error('Could not find "Your Profile" link');
    await profileLink.click();

    // Wait for the profile page to load by waiting for a unique element (Jun's profile image alt text)
    // We'll look for an <img> with alt containing "Jun Kim" (from profile data)
    await page.waitForSelector('img[alt*="Jun Kim"]', { timeout: 5000 });

    // Take screenshot of the profile page
    const step3 = path.join(screenshotsDir, 'step_3_profile_page.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract Jun's profile name and username from the profile header
    const profileName = await page.$eval('.profile-header .profile-info h2', el => el.textContent.trim());
    const profileUsername = await page.$eval('.profile-header .profile-info .username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile header",
      extractedData: {
        profileName,
        profileUsername
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
